import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import { BlogPage } from './BlogPage';

function Menu(){
    return(
 <> 
        {routes.map(route => (
                <Link className="nav-link"
                    to={route.to} >
                         <li className="nav-item"> {route.text} </li>
                </Link>
             
        ))} 
</>
    )
}

const routes = [];

routes.push({
    to:'/',
    text:'home'
})
routes.push({
    to:'aprende/articulos/',
    text:'blog'
})
routes.push({
    to:'/profile',
    text:'profile'
})

export {Menu}
